ked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="51"\r\n   Name="List Table 6 Colorful Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 6"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Обычная таблица";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">Если авторизация прошла\r\nуспешно, то пользователь должен быть перенаправлен на страницу с системой. При\r\nвходе на сайт генерируется и записывается в базу данных код, который будет\r\nоднозначно определять сессию пользователя. </span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">Если\r\nпользователь неправильно ввел логин или пароль, то выводится сообщение о\r\nнеудачной попытке входа.</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">Если пользователь нажал кнопку «Забыли\r\nпароль?», то перенаправить его на страницу восстановления пароля, где он может\r\nзапросить новый, введя адрес электронной почты. </span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">После система проверяет, есть ли такой\r\nадрес, а потом генерирует уникальный ключ и передает на введенный e-mail в виде\r\nтекста и ссылки для смены пароля. </span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">Перейдя по ссылке, пользователь видит\r\nстраницу, где нужно ввести новый пароль и его подтверждение. В случае успеха,\r\nсистема удаляет ключ для восстановления пароля и вносит в базу изменения.</span></p>\r\n\r\n', 0);
