eption Locked="false" Priority="51"\r\n   Name="List Table 6 Colorful Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 6"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Обычная таблица";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">Отчет формируется<span style="mso-spacerun:yes">&nbsp; </span>на основе сохраненных для выбранного проекта\r\nданных в БД в соответствии со стандартом<span style="mso-spacerun:yes">&nbsp;\r\n</span>ГОСТ 19.201. </span></p>\r\n\r\n<p class="MsoNormal"><strong><span style="font-size:12.0pt">&nbsp;</span></strong></p>\r\n\r\n<p class="MsoNormal"><strong><span style="font-size:12.0pt">Алгоритм формирования отчета</span></strong><span style="font-size:12.0pt"> </span></p>\r\n\r\n<span style="font-size:12.0pt">&nbsp;</span>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">При создании проекта в дерево\r\nразделов автоматически добавляются разделы, которые невозможно удалить:</span></p>\r\n\r\n<p class="MsoListParagraphCxSpFirst" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt">Функциональные\r\nтребования </span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt">Требования к\r\nнадежности </span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt">Условия\r\nэксплуатации</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt">Требования к\r\nсоставу и параметрам технических средств</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt">Требования к\r\nинформационной и программной совместимости</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt">Требования к\r\nмаркировке и упаковке</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt">Требования к\r\nтранспортированию и хранению</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt"><span style="mso-spacerun:yes">&nbsp;</span>Специальные требования</span></p>\r\n\r\n<p class="MsoListParagraphCxSpLast" style="text-indent:-18.0pt;mso-list:l0 level1 lfo1"><span style="font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-size:12.0pt">Требования к\r\nпрограммной документации</span></p>\r\n\r\n<span style="font-size:12.0pt">&nbsp;</span>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">Требования, занесенные в эти\r\nразделы, используются при формировании ТЗ в соответствии с ГОСТ 19.201 и\r\nструктурой подразделов, созданной пользователем.</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">Если раздел пустой ( не\r\nсодержит требований), то в него записывается “Не предъявляются”.</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt">ТЗ создается и представляется\r\nпользователю<span style="mso-spacerun:yes">&nbsp; </span>в формате </span><span style="font-size:12.0pt;mso-ansi-language:EN-US" lang="EN-US">HTML</span><span style="font-size:12.0pt">.</span></p>\r\n\r\n<span style="font-size:12.0pt">&nbsp;</span>\r\n\r\n', 0);
