(53, 9, 'Требования к составу и параметрам технических средств', '<p>В состав технических средств должен входить персональный <span style="letter-spacing:-.15pt">компьютер. </span>В случае работы системы в сети\r\nвсе компьютеры должны быть подобны. Так же необходимы кабеля для создания сети,\r\nсетевые карты на каждом компьютере и маршрутизатор. При предоставлении\r\nвозможности поступления информации через сеть Интернет, один из компьютеров в\r\nсети, не являющийся сервером, должен иметь модем.</p>', 0, 0, 0),
