ption Locked="false" Priority="51"\r\n   Name="List Table 6 Colorful Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 6"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Обычная таблица";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:10.0pt">Для\r\nфункционала сайта должна использоваться система управления базами данных </span><span style="font-size:12.0pt;mso-bidi-font-size:10.0pt;mso-ansi-language:\r\nEN-US" lang="EN-US">MySQL</span><span style="font-size:12.0pt;mso-bidi-font-size:10.0pt">.</span></p>\r\n\r\n<span style="font-size:12.0pt;mso-bidi-font-size:10.0pt">&nbsp;</span>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:10.0pt">Так\r\nкак интерфейсом для взаимодействия системы с пользователем является\r\nвеб-браузер, страницы портала должны соответствовать стандарту HTML5. Для\r\nсовместимости с устаревшими версиями браузеров сайт должен поддерживать\r\nстандарт HTML4. Запросы к базе данных должны соответствовать стандартам языка\r\nSQL. </span></p>\r\n\r\n<span style="font-size:12.0pt;\r\nmso-bidi-font-size:10.0pt">&nbsp;</span>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:10.0pt">После\r\nпервой загрузки страницы, все остальные изменения происходят при помощи AJAX-запросов,\r\nчтобы браузеру пользователя не пришлось загружать ее заново каждый раз.</span></p>\r\n\r\n', 0, 0, 0);
